<script>



  //sample data values for populate map

  var data = <?php echo json_encode($array); ?>;
   //them mới 26

  var map = new L.Map('map');  //set center from first location

  map.addLayer(new L.TileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png')); //base layer

  var markersLayer = new L.LayerGroup();  //layer contain searched elements
  
  map.addLayer(markersLayer);

  var controlSearch = new L.Control.Search({
    position:'topright',    
    layer: markersLayer,
    initial: false,
    zoom: 20,
    marker: false
  });

  map.addControl(controlSearch );

  ////////////populate map with markers from sample data

  for (var i = 0; i < data.length; i++) {

    var title =data[i][2],
    loc =[data[i][0],data[i][1]],

    // var title = data[i].title, //value searched
    //  loc = data[i].loc,    //position found
      marker = new L.Marker(new L.latLng(loc), {title: title} );//se property searched
      marker.bindPopup(
        '<table> <thead > <tr> <th >Tên mỏ</th> <th >'+data[i][2]+'</th> </tr> </thead> <tbody> <tr> <td>Loại khoáng sản:</td> <td>'+data[i][4]+'</td> </tr> <tr> <td>Vị trí hành chính:</td> <td>'+data[i][3]+'</td> </tr> <tr> <td>Vị trí tọa độ</td> <td>'+data[i][5]+'</td> </tr> </tbody> </table> <style type="text/css"> table{ border:1px solid #24355A; border-collapse:collapse; } th{ border:1px solid #24355A; background-color: #4CAF50; color:white; text-align:left; padding:10px;} td{ border:1px solid #24355A; text-align:left; padding:10px; } </style>'
        );
      markersLayer.addLayer(marker);
    } 

</script>

